jobTitle:
I believe in motivating and inspiring others to learn with content that they can connect to; I believe in empowering others by helping them build strong technical skills and critical skills such as problem-solving, analytical thinking, collaboration, independent thinking and scientific writing. Classes:
- Bayesian Models of Behavior (graduate; Spring 2021), with Prof. Weiji Ma;
- Data Simulation and Analysis (graduate; Spring 2020, Spring 2018), with Prof. Laurence Maloney;
- Functional magnetic resonance imaging lab (graduate; Fall 2019), with Prof. David Heeger;
- Advanced Psychological Statistics (undergrad; Spring 2021, Fall 2020), with Prof. Pascal Wallisch;
- Perception (undergrad; Spring 2019, Summer 2017, Spring 2017), with Prof. Laurence Maloney and Dr. Jingyang Zhou;
